≈ÚµU<?php exit; ?>a:1:{s:7:"content";s:606:"Rachel is a Clinical Psychologist who has extensive experience working with children and families. Her passionate and creative approach helps to bring fun into the therapy setting. Rachel specialises in the assessment and treatment of psychological disorders that impact on children, adolescents, adults and families. She has worked in mental health services both in Australia and the United Kingdom, and has extensive training and experience working with family members and systems who have been impacted by trauma. She has a special interest in parent-child relationships and early emotional development.";}